                    <div class="section-panel-body">
                        <p>按閣下選擇的持股日期所顯示的資料乃假設相關款項交收正式完成後，中央結算系統參與者於該日日終的合計持股量。如果所選擇的持股日期是星期日或香港公共假期，則會顯示最後一個非星期日或香港公共假期的持股紀錄。
<br/><br/>
滬港通及深港通持股紀錄查詢服務僅提供自 <b>2017年3月17日</b> 的持股紀錄，資料將按持股日期起計保留12個月。</p>
                        <div class="filter__container-ccass-mutual-market">  
